    useEffect(()=>{
        fetch("https://jsonplaceholder.typicode.com/todos")
        .then((res)=>{
            return res.json()
        })
        .then((resp)=>{
            console.log(resp)
            setData(resp)
        })
         
    })
    
    return(
        <div>
          <h1>Hook's Method</h1>
        </div>
    )
}
export default Data;
